import React from 'react';
// import './Flights.css';

function Currency(props) {
    return(
        <div className="currencies">
            <select></select>
            {props.currencies.map(currency => {
                return (<option value={currency.Code}>{currency.Symbol}</option>);
            })}
        </div>
    )
}

export default Currency;
